import * as React from "react";
import "./style-ping.css";
import * as Mui from "@material-ui/core";

export default function PingDummy({ urlData }) {
	return (
		<>
			<Mui.Box className="resultsMain">
				<Mui.TableContainer component={Mui.Paper}>
					<Mui.Table style={{ minWidth: "700" }} aria-label="customized table">
						<Mui.TableHead>
							<Mui.TableRow>
								<Mui.TableCell className="header">
									<b>Top Ping Sites</b>
								</Mui.TableCell>
								<Mui.TableCell className="header" align="right">
									<b>Count</b>
								</Mui.TableCell>
								\
							</Mui.TableRow>
						</Mui.TableHead>
						<Mui.TableBody>
							{urlData.map((elem) => (
								<Mui.TableRow key={elem.url}>
									{" "}
									<Mui.TableCell component="th" scope="row">
										{elem.url}
									</Mui.TableCell>
									<Mui.TableCell align="right">{elem.count}</Mui.TableCell>
								</Mui.TableRow>
							))}
						</Mui.TableBody>
					</Mui.Table>
				</Mui.TableContainer>
			</Mui.Box>
		</>
	);
}
